Spectrum HoloByte, Inc. was a video game developer and publisher. The company, founded in 1983, was known for its [[simulation video game|simulation games]], notably the [[Falcon (video game)|Falcon]] series of combat flight simulators, and for publishing the first version of [[Tetris]] outside the Soviet Union (in 1988 for [[MS-DOS]]). Spectrum HoloByte published games for various home computers and [[Video game console|video game consoles]].
